window.bookSummaryJSON = "<p><b>He’s not just going to take me. He’s going to tame me.</b></p> <p>After escaping both my father’s plans to marry me off and the Russian mafia, I woke up this morning thinking I was a free woman...until I saw the man sipping coffee in my hotel room.</p> <p>He’s a billionaire as powerful as any mob boss, yet even as he spanks me into soaking wet, shameful surrender I can’t help begging him to ravage my virgin body right then and there.</p> <p>I can run, but I know soon I’ll be kneeling at his feet, bare, blushing, and ready to be claimed.</p> <p>Because I’m his to take.</p> <p><i>Mine to Take</i> is a standalone novel and the third book in the Kept as His series. Contains mature content.</p>"; 
